import React from 'react';
import { Link } from 'react-router-dom';

const PageTitle = ({ headline, action, url }) => {
    return (
        <div className="headline">
            <div className="row">
                <h1>{headline}</h1>
            </div>

            <div className="row">
                <div className="action">

                    <Link to={url}>
                        <a>{action}</a>
                    </Link>
                </div>
            </div>

        </div>
    );
}

export default PageTitle;
